Legionnaires #10
Publisher:  DC Comics
Publication Date:  January 1994

Writers:  Tom Bierbaum and Mary Bierbaum
Pencillers:  Chris Sprouse, Adam Hughes, and Stuart Immonen
Inkers:  Karl Story and Mark Farmer
Colorist:  Tom McCraw
Letterer:  Pat Brosseau
Cover:  Chris Sprouse, Karl Story, and Tom McCraw  

Cosmic Boy is rushed to the hospital while Computo takes over the team as deputy leader. Trying to aid the citizens of Earth with food rations, the Legion learns they have to infiltrate the Sklarian pirates who are stealing the food. Meanwhile, other Legionnaires find the body of James Cullen, Kid Quantum, in a crashed Khund spaceship.

